import React from 'react';
import './EncabezadoEyS.css';
import Table from 'react-bootstrap/Table'

const ComponenteEyS = () => {
    return (
        <Table striped bordered hover class="table">
        <tbody>
            <tr>
            <td>24153602</td>
            <td>$100.000,00</td>
            <td>Pago por alquiler</td>
            <td>000034134313</td>
            </tr>
        </tbody>
        </Table>
  );
}


export default ComponenteEyS;
